webpackJsonp([0x65a8962e0250],{9104:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Ray of Light",date:"26 Nov 2001",slug:"/2001-11-26-ray-of-light/",tags:"Y2001"},html:'<p>Not all dot.coms are bombing. My employer just posted a 3rd quarter profit of 2000 Euros. Good thing no one raided the petty cash, we could have ended up with a loss! ";->" On the other hand, one of our main competitors just declared itself insolvent.</p>\n<p>Dave has written a press release proclaiming that <a href="http://www.userland.com/stories/storyReader$136">SOAP 1.1 and<br />\nXML-RPC work with 802.11b</a>. What I\'d really like to know is whether<br />\nthey work with another wireless protocol, namely <a href="http://www.blug.linux.no/rfc1149/">CPIP as per RFC 1149</a> <i>CPIP = Carrier Pigeon Internet Protocol</i> ";->"</p>'},next:{fields:{title:"When You Were Mine",date:"25 Nov 2001",slug:"/2001-11-25-when-you-were-mine/"}},previous:{fields:{title:"Naptime",date:"28 Nov 2001",slug:"/2001-11-28-naptime/"}}},{node:{fields:{title:"When You Were Mine",date:"25 Nov 2001",slug:"/2001-11-25-when-you-were-mine/",tags:"Y2001"},html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2001/11/crhknife.jpg" height="262" width="350" border="0" alt="crhknife.jpg: " /></p>\n<p>We wanted to show Christopher eating in continental fashion with fork and knife, but by the time we got the camera out, he was eating in pirate fashion with just a knife.</p>\n<p>For those of you following Christopher\'s progress on the troublemaking department, you may recall that a few weeks ago he was able to <a href="/2001/09/03">flush the toilet by himself</a>. Now he\'s much more sophisticated. He\'s able to go into the bathroom, pull out two rolls of fresh toilet paper, tear off several meters from each, open the toilet, stuff the torn-off paper into the toilet, and flush. <a href="http://scriptingnews.userland.com/backissues/2001/11/25">"Puhhhh-tahhhh"</a>, as Dave would say.</p>\n<p>If Frontier programmers exclaim "Puhhhh-tahhhh" when they get something to work, I guess a Perl programmer would exclaim "She-bang!". (Perl programs usually begin with a line "#!/usr/bin/perl", and first two characters, hash sign/excclamation point, are referred to as \'she\' and \'bang\'.)</p>'},next:{fields:{title:"I'm Thankful for Deutsche Telekom",date:"24 Nov 2001",slug:"/2001-11-24-im-thankful-for-deutsche-telekom/"}},previous:{fields:{title:"Ray of Light",date:"26 Nov 2001",slug:"/2001-11-26-ray-of-light/"}}},{node:{fields:{title:"I'm Thankful for Deutsche Telekom",date:"24 Nov 2001",slug:"/2001-11-24-im-thankful-for-deutsche-telekom/",tags:"Y2001"},html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2001/11/crhphone.jpg" height="296" width="350" border="0" alt="crhphone.jpg: " /></p>\n<p>Christopher talking to his grandparents in Minnesota. More recent action pics <a href="http://photos.shcon.com/index.php?album=11_2001%2F20011124&dispsize=512&start=0">here</a>.</p>\n<p>We\'ve now extracted ourselves from the fiendish clutches of <a href="http://www.telekom.de">Deutsche Telekom</a>. Our entire telephone connection is now with <a href="http://www.ewetel.net">EWE Tel</a>, and we can once again surf (and not to mention work) on the Internet without looking over our shoulder at the meter. It\'s only ISDN. Maybe someday we\'ll get broadband here. Maybe not. </p>\n<p>After <a href="http://scriptingnews.userland.com/backissues/2001/11/23">seeing on Scripting News</a> that seven-year-old <a href="http://scobleizer.ManilaSites.Com/2001/09/01">Patrick Scoble</a> has a weblog, I added it to my favorites. Now, as you see, <a href="http://radio.weblogs.com/0001099/">his weblog</a> is gone. Ironic that a Userland product suffers from linkrot.</p>'},next:{fields:{title:"Turkey Day",date:"22 Nov 2001",slug:"/2001-11-22-turkey-day/"}},previous:{fields:{title:"When You Were Mine",date:"25 Nov 2001",slug:"/2001-11-25-when-you-were-mine/"}}}],pathPrefix:"",first:!1,last:!1,index:958,pageCount:1101}}}});
